export const Dekarka = () => {
  return (
    <div>
      <h2>Prace dekarskie</h2>

      <p>
        Prace dekarskie Pełen zakres prac związanych z pokryciami dachowymi i
        systemami odprowadzania wody. Między innymi: uszczelnienia, montaż,
        wymiana, naprawa: rur spustowych, rynien, obróbek blacharskich ,ław
        kominiarskich. Przy realizacji prac dekarskich wykorzystujemy różnego
        rodzaju materiały oraz używamy różnych technologii. Przy montażu obróbek
        blacharskich, rynien, rur spustowych korzystamy z szerokiej gamy
        materiałów.{" "}
      </p>
    </div>
  );
};
